<template>
    <PageComponent header="CCE Deanâ€™s Office Document Management System">
        <div class="text-3xl font-bold sm:px-6 lg:px-16 hidden sm:block">
            AVAILABLE DELIVERABLE TEMPLATES
        </div>

        <div class="mx-16 hidden sm:block">
            <div class="border-b-2 border-black" style="width: 700px;"></div>
        </div>

        <div v-if="uniqueTemplates.length === 0" class="text-center mt-5">
            No uploaded templates
        </div>

        <div class="flex flex-wrap px-20 py-5">
            <div v-for="uniqueTemplate in uniqueTemplates" :key="uniqueTemplate.id" class="flex-none px-4 py-2 w-1/4">
                <router-link :to="`/user/detailedTemplates/${uniqueTemplate.id}`">
                    <div class="text-center">
                        <div class="flex flex-col items-center">
                            <svg width="123" height="113" viewBox="0 0 123 113" fill="none"
                                xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink">
                                <rect width="123" height="113" fill="url(#pattern0)" />
                                <defs>
                                    <pattern id="pattern0" patternContentUnits="objectBoundingBox" width="1" height="1">
                                        <use xlink:href="#image0_11_219"
                                            transform="matrix(0.00369004 0 0 0.00401659 0 -0.0040819)" />
                                    </pattern>
                                    <image id="image0_11_219" width="271" height="251"
                                        xlink:href="data:image/png;base64," />
                                </defs>
                            </svg>
                            <div class="mt-auto">{{ uniqueTemplate.type }}</div>
                        </div>
                    </div>
                </router-link>
            </div>
        </div>
    </PageComponent>
</template>
  
<script setup>
import axios from 'axios';
import PageComponent from '../../components/PageComponent.vue';
import { ref, onMounted, computed } from 'vue';

const templates = ref([]);

const fetchDeliverableTemplates = async () => {
    try {
        let response = await fetch('http://127.0.0.1:8000/api/get-templatesUser');
        if (response.ok) {
            let data = await response.json();
            templates.value = data;
        } else {
            console.error("Failed to fetch deliverable templates");
        }
    } catch (error) {
        console.error("An error occurred:", error);
    }
};

onMounted(() => {
    fetchDeliverableTemplates();
});

const desiredKeywords = ['tos', 'sim', 'syllabus'];

const typeMatchesDesiredKeywords = (type) => {

    type = type.toLowerCase();

    return desiredKeywords.some(keyword => type.includes(keyword));
};

const uniqueTemplates = computed(() => {
    return templates.value.filter((template) => {

        return typeMatchesDesiredKeywords(template.type.toLowerCase());
    });
});
</script>
  
